// Profile Iterator
function profileIterator(profileData) {
  let nextIndex = 0;

  return {
    next: function () {
      return nextIndex < profileData.length
        ? { value: profileData[nextIndex++], done: false }
        : { done: true };
    },
  };
}

const profile = profileIterator(data);

// Next Event
document.getElementById('next').addEventListener('click', nextProfile);

// Next profile Display
function nextProfile() {
  const currentProfile = profile.next().value;

  if (currentProfile !== undefined) {
    document.querySelector('.desc').innerHTML = '';
    document.getElementById('next').innerHTML = 'Next';
    document.getElementById('title').innerHTML = `In At: ${currentProfile.inAt}`;

    document.getElementById('profileDisplay').innerHTML = `
    <ul class="list-group">
      <li class="list-group-item">Name: ${currentProfile.name}</li>
      <li class="list-group-item">Country: ${currentProfile.country}</li>
      <li class="list-group-item">Role: ${currentProfile.role}</li>
      <li class="list-group-item">Jersy No: ${currentProfile.jersyNo}</li>
      <li class="list-group-item">${currentProfile.about}</li>
    </ul>  
  `;

    document.getElementById(
      'imageDisplay'
    ).innerHTML = `<img src="${currentProfile.image}" alt="${currentProfile.name}'s image">`;
  } else {
    document.getElementById('profileDisplay').innerHTML = `<h1>This is my dream 11, What's yours? 😏😂</h1>`;
    document.getElementById('imageDisplay').innerHTML = '';
    document.getElementById('title').innerHTML = '';
    document.getElementById('next').style = 'display: none';
    
    setTimeout(function () {
      window.location.reload();
    }, 3500);
  }
}
